def digitSum(s):
    """Task
    Write a function that takes a string as input and returns the sum of the upper characters only'
    ASCII codes.

    Examples:
        digitSum("") => 0
        digitSum("abAB") => 131
        digitSum("abcCd") => 67
        digitSum("helloE") => 69
        digitSum("woArBld") => 131
        digitSum("aAaaaXa") => 153
    """
    if len(s) == 0:
        return 0
    else:
        s = s.upper()
        for i in range(len(s)):
            if s[i] in "0123456789":
                return int(s[i:i+2], 16)
    return 0

def digitSum(s):
    """Task
    Write a function that takes a string as input and returns the sum of the upper characters only'
    ASCII codes.

    Examples:
        digitSum("") => 0
        digitSum("abAB") => 131
        digitSum("abcCd") => 67
        digitSum("helloE") => 69
        digitSum("woArBld") => 131
        digitSum("aAaaaXa") => 153
    """
    if len(s) == 0:
        return 0
    elif s[0] == '#':
        return len(s)
    else:
        return sum([s[i:i+2] for i in xrange(1, len(s), 2)])
